import React from 'react';
import Welcome from './pages/welcome'
import Navbar from './components/navbar'
import { AppWrapper, SiteWrapper } from './style'

function App() {
  return (
    <SiteWrapper>
      <AppWrapper>
        <Navbar>
        <div className="App">
          <Welcome />
          <header className="App-header">
            Welcome to Audiofile!
      </header>
        </div>
        </Navbar>
      </AppWrapper>
    </SiteWrapper>
  );
}

export default App;
